
create extension if not exists "uuid-ossp";

drop table if exists vendor_dms, product_6qy, vendor_product_info_ieh, transport_2xo, vendor_transport_info_vz0 cascade;

create table vendor_dms
(
    id      uuid primary key,
    name    text,
    phone   text
);

create table product_6qy
(
    id              uuid primary key,
    model           text,
    category        text,
    brand           text,
    score           numeric,
    screen_material text,
    screen_size     int,
    height          int,
    width           int,
    weight          int,
    sales_start     int,
    sales_end       int,
    os              text,
    color           text
);

create table vendor_product_info_ieh
(
    vendor_id uuid references vendor_dms,
    product_id uuid references product_6qy,
    price numeric,
    quantity int,
    primary key (product_id, vendor_id)
);

create table transport_2xo
(
    id                uuid primary key,
    model             text,
    body_volume       int,
    lifting_capacity  int
);

create table vendor_transport_info_vz0
(
    vendor_id uuid references vendor_dms,
    transport_id uuid references transport_2xo,
    quantity int,
    primary key (transport_id, vendor_id)
);


