--task 1
select model, category, brand from product_6qy pq
join vendor_product_info_ieh vpii on vpii.product_id = pq.id
join vendor_dms vd on vpii.vendor_id = vd.id
where (brand = 'Apple' or brand  = 'Samsung') and (category = 'смартфоны' or category = 'ноутбуки')

--task 2
select vd.name from vendor_dms vd
join vendor_product_info_ieh vpii on vpii.vendor_id  = vd.id
join product_6qy pq on vpii.product_id = pq.id
where pq.brand = 'Apple'
intersect
select vd.name from vendor_dms vd
join vendor_product_info_ieh vpii on vpii.vendor_id  = vd.id
join product_6qy pq on vpii.product_id = pq.id
where pq.brand = 'Samsung'

--task 3
select vd.name from vendor_dms vd
join vendor_product_info_ieh vpii on vpii.vendor_id  = vd.id
join product_6qy pq on vpii.product_id = pq.id
where pq.category = 'часы'
intersect
select vd.name from vendor_dms vd
join vendor_product_info_ieh vpii on vpii.vendor_id  = vd.id
join product_6qy pq on vpii.product_id = pq.id
where pq.category != 'смартфоны'

--task 4
select vd.name from vendor_dms vd
join vendor_product_info_ieh vpii on vpii.vendor_id  = vd.id
join product_6qy pq on vpii.product_id = pq.id
where pq.brand = 'Apple'
union
select vd.name from vendor_dms vd
join vendor_transport_info_vz0 vtiv on vtiv.vendor_id = vd.id
join transport_2xo tx on vtiv.transport_id = tx.id
where tx.body_volume between 27 and 30

--task 5
select min(price), max(price), avg(price), sum(price) from vendor_product_info_ieh vpii
join product_6qy pq on vpii.product_id = pq.id 
where pq.category = 'часы' and pq.brand = 'Apple' 

--task 6
select pq.model from product_6qy pq
join vendor_product_info_ieh vpii on vpii.product_id = pq.id
where pq.category = 'мониторы' and vpii.price = 
(
select max(price) from vendor_product_info_ieh vpii2
join product_6qy pq2 on pq2.id = vpii2.product_id
where pq2.category = 'мониторы'
)

